    def containsNearbyAlmostDuplicate(self, nums: List[int], k: int, t: int) -> bool:            
        """
        滑动窗口 + 桶排序

        滑动窗口 大小为k， 在窗口内，win_max, win_min
        当前数 cur_num
        1. cur_num > win_max + t or  cur_num < win_min - t 
            即 于窗口内的 数值差距 大于 t 那么就 pass
        2. cur_num in [win_min-t, win_max+t] 那么就采用普通的搜索策略

        一般用暴力手段即可，但是这里还可以采用桶排序的手段优化
        在维持当前的滑动窗口内，可以用t作为桶间距，把num分布到各个桶内部，并附上编号
        类似 contains-duplicate II 里面的 marked 用来标记 重复数值的 位置，只不过用
        桶的策略优化 t 这个判断条件

        t = 2, 每个桶内的数字范围如下,桶大小 t+1,保证桶内的数字间距 <= t
        编号          ...     -2            -1             0           1      ...      
                        -------        -------       -------     -------     
        桶内数字范围      | -6 ~ -4  |    | -3 ~ -1 |   | 0 ~ 2 |   | 3 ~ 5 |  
                        -------        -------       -------     -------        
        cur_num , cur_bucketID
        1 cur_bucketID in bucket ， 桶内有值，表面 t 间距范围内，一定满足条件 + 滑动窗口k 也满足， return True
        2. pre_bucketID, post_bucketID 相邻的桶内也有可能 和 cur_bucketID 存在 t 间距范围的 值，检测一下
        3. 上述2个条件不满足，那么就开始滑动窗口，则需要删除窗口的第一个值，就需要桶中删除第一个数的值，同时当前值也入bucket
        """
        bucket = {} # id -> num
        width = t+1
        for i, num in enumerate(nums):
            # 滑动窗口，删除窗口的第一个数
            if i > k:
                first = nums[i-k-1]
                firstID = self.getBucketID(first, width)
                if bucket[firstID] == first:
                    bucket.pop(firstID)
            
            curID = self.getBucketID(num, width)
            if curID in bucket:
                return True
            pre = curID-1
            if pre in bucket and (num - bucket[pre] < width):
                return True
            post = curID+1
            if post in bucket and (bucket[post] - num < width):
                return True
            
            bucket[curID] = num
        else:
            return False

    def getBucketID(self, num, width):
        """
        获取桶id
        """    
        if num>=0:
            return num // width
        else: # 负数填补0空缺：num+1 , 然后编号左移-1
            return (num+1)//width - 1

